import React, { Component } from "react";
import "./my_css.css";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import m1 from  "./images/m1.jpg";
export class Home extends Component {
  render() {
    return (
      <div
        class="row"
        style={{
          marginTop: "15rem",
          marginLeft: "0px",
          marginRight: "1rem",
          padding: "1px 1px 1px 1px",
        }}
      >
        <div class="col-sm-6">
          <img
            class="card-img-top"
            src={m1}
            alt="Card image cap"
            style={{ height: "15rem", width: "20rem" }}
          />
          <div class="card-body">
            <h5
              class="card-title"
              style={{ backgroundColor: "white", width: "20rem" }}
            >
              Rail Tour Package
            </h5>
            <p class="card-text" style={{ width: "20rem" }}>
              With supporting text below as a natural lead-in to additional
              content.
            </p>
          </div>
        </div>
        <div class="col">
          <img
            class="card-img-top"
            src={m1}
            alt="Card image cap"
            style={{ height: "15rem", width: "20rem" }}
          />
          <div class="card-body">
            <h5
              class="card-title"
              style={{ backgroundColor: "white", width: "20rem" }}
            >
              Rail Tour Package
            </h5>
            <p class="card-text" style={{ width: "20rem" }}>
              With supporting text below as a natural
            </p>
          </div>
        </div>
        <footer id="footer">
          Get connected on Social media 
        </footer>

      </div>
    );
  }
}

export default Home;
